import React, { Component } from 'react';
import { Route, Switch } from 'react-router-dom';
import "bootstrap-icons/font/bootstrap-icons.css";
import Main from './Blog/Main';
import About from './Blog/About';
import Header from './Blog/Header';
import CreateCategory from './Blog/CreateCategory';
import CreateBlog from './Blog/CreateBlog';
import ManageSubject from './Blog/ManageSubject';
import ManageBlog from './Blog/ManageBlog';
import Error from './Blog/Error';
import EditSubject from './Blog/EditSubject';

export class App extends Component {
  render() {
    return (
      <React.Fragment>
        <Header />
        <Switch>
          <Route exact path='/' component={About} />
          <Route exact path='/*' component={Error} />
          <Route exact path='/user' component={Main} />
          <Route exact path='/admin/addsubject' component={CreateCategory} />
          <Route exact path='/admin/createblog' component={CreateBlog} />
          <Route exact path='/admin/managesubject' component={ManageSubject} />
          <Route exact path='/admin/editsubject/:sid' component={<EditSubject {...this.props} />} />
          <Route exact path='/admin/manageblog' component={ManageBlog} />
        </Switch>
      </React.Fragment>
    )
  }
}

export default App
